import styled from "styled-components";

const Wrapper = styled.div`
  padding: 20px;
  text-align: center;
`;

const Title = styled.h2`
  font-size: 28px;
  color: #27a745;
`;

function PostViewPage() {
  return (
    <Wrapper>
      <Title>글 상세보기 페이지입니다</Title>
    </Wrapper>
  );
}

export default PostViewPage;
